import React from 'react';

const ImageCard = ({ image }) => {
  return (
    <div className="bg-gradient-to-r from-slate-300 to-slate-500 rounded-lg shadow-md p-4">
      <img
        src={image.urls.regular}
        alt={image.alt_description}
        className="w-full h-auto rounded-lg"
      />
      <div className="mt-4">
        <div className="text-gray-800 font-bold">
          <a
            href={`https://www.instagram.com/${image.user.instagram_username}`}
            target="_blank"
            rel="noopener noreferrer"
          >
            {image.user.name}
          </a>
          <div className="text-sm text-gray-600 mt-1">
            Uploaded on {new Date(image.created_at).toDateString()}
          </div>
        </div>
        <div className="flex items-center mt-2">
          <img
            src="https://img.icons8.com/?size=128&id=4T5VAk5CB92r&format=png" // Replace with your heart icon image source
            alt="Heart"
            className="w-6 h-6 mr-2"
          />
          <span className="text-gray-600">
            {image.likes} Likes
          </span>
        </div>
      </div>
    </div>
  );
};

export default ImageCard;
